    const circlesToMake = numUnits;

    return (
        <div className={styles.timeColumn}>
            <div>{binary}</div>
            {binary && [...Array(numUnits)].map((_, index) => (
                <Unit isOn={binary[index]} />
                // <h1 key={index}>{binary[index]}</h1>
            ))}

        </div>
    );
}

export default TimeColumn;
